theorem
fixes A B C D E P :: real
assumes h0 : "A = 128"
and h1 : "B = 92"
and h2 : "C = 113"
and h3 : "D = 111"
and h4 : "P = 360 - A - B - C - D"
shows  "P = 96"
 proof- 
  show ?thesis sledgehammer

